Before:

```ts
type Test = (string | number);
```

After:

```ts
type Test = string | number;
```

Also fixes an edge case of someone having a back slash as the last character in a JSX string literals (which work differently than regular string literals 🙄):

```ts
// should format as-is, but previously removed the back slash
const t = <div prop="\" />;
```
